snippet.description:
I coded this Minecraft update in 7 days that adds an entirely new pillager city, and even coded a new custom Minecraft boss.  What do you think a pillager overhaul would look like if Mojang updated them?

Want to download this #Minecraft #datapack?  You can download it from my Patreon: https://www.patreon.com/WhimzeeYT

0:00 Intro
0:58 Day 1 - Houses and Crippling Failure
2:19 Day 2 - Roads to Redemption
3:42 Day 3 - A Dance of Mathematics
5:43 Day 4 - THE GRAND HALL
8:21 Day 5 - The Power of Odin
9:33 Day 6 - Coding the Pillager Boss
11:23 Day 7 - Mega Swords and Taxes
14:32 My Friends Fighting the Boss

PLEASE go show these guys some love, this video would not have been possible without their contributions:

@Zeplington For building the Grand Hall, the builds on his channel are works of art: @Zeplington 
@AFRHmusic For the epic boss music!  You can listen to the full song here: https://www.youtube.com/watch?v=cOJgwQa28Dw
Maugwei for the incredible boss model.  He makes a ton of cool art: https://www.artstation.com/maugwei

Also, thanks to my friends for playing through the boss!
@AvidMc 
@Knarfy 
@McMakistein 
@CodeNeonMC 
